class ColBlackBody(cYxy):
    """ Black Body color class """
    def __init__(self, temp=5000, *args, **kwargs):    # default: 5000K
        """ Init temp & Yxy values from temperature passed as argument """
        self.type = 'BlackBody'     # can be used instead of isinstance on an object

        if isinstance(temp, str):
            temp = int(temp)

        self.Temp = temp

        cYxy.__init__(self, *self.fromTemp(self.Temp), *args, **kwargs)

    def fromTemp(self, temp):
        tmp = list(RefBlackBody.dBlackBody_xy.get(temp))
        tmp.insert(0, 1.0)
        return tmp


